INSERT INTO `v1_3864a65736c6e1f62607a8360264a309cd732aa5f2ed67b7b9918e2eb87f3838` VALUES (72021, 72, 10, 0, "だからわたし、\n勇気を出して言ってみたんです！\nお友だちになりませんか、って。", 0, 1, 11, 1, 1, 0);
