INSERT INTO `v1_3864a65736c6e1f62607a8360264a309cd732aa5f2ed67b7b9918e2eb87f3838` VALUES (72025, 72, 10, 0, "そしたらアオイさん、\n顔を真っ赤にして、ブンブン！　って、\n首を縦に振ってくれて。\nやった！　って思ったんですよね。", 0, 1, 11, 1, 1, 0);
