INSERT INTO `v1_3864a65736c6e1f62607a8360264a309cd732aa5f2ed67b7b9918e2eb87f3838` VALUES (72029, 72, 10, 0, "……でもその後、\n心の準備が欲しいって言われちゃって。\n心の準備、300年くらいかかるかも\nしれないんだそうです……", 0, 1, 11, 1, 1, 0);
